import React, { Component } from "react";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="menu">
        <button
          className="burger-button"
          onClick={() => this.props.closePopup()}
        >
          Bibliografie
        </button>
      </div>
    );
  }
}

export default Popup;
